import React from "react";
import { Component } from "react";
import { withRouter } from "react-router-dom";
import styles from "./accessdenied.module.css";
import deniedsymbol from "../../img/access-denied.gif";

class accessdenied extends Component {
    render() {
        return (
            <>
                <div className={styles.image}>
                    <img src={deniedsymbol} />
                </div>
                <div className={styles.message}>
                    ACCESS DENIED!
                </div>
                <div className={styles.info}>
                    We have found an illegal access to our system.
                </div>
                <div className={styles.button}><center><a href="#"> Go to home page</a></center></div>
            </>
        )
    }
}

export default withRouter(accessdenied)
